import { AppBar, Toolbar } from "@mui/material";

// compponents
import LoginDialog from "./account/LoginDialog";

const Messenger = () => {
  return(
    <AppBar position="static">
      <Toolbar>
        <LoginDialog />
      </Toolbar>
    </AppBar>
  )
};

export default Messenger;
